import React from 'react'
import './Footer.css'

export default function Footer() {
    return (
        <div className="footer-container">
          <div className="footer-parent">
              <img src={require ('../../../assets/home/shape-bg2.png').default} alt="no internet connection"/>
          </div>
        </div>
    )
}
